package Day7;

public class SwappingString {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s1= "welcome";
		String s2= "Java";
System.out.println("Swapping string: "+s1+ " "+s2);
   String temp= s1;
   s1=s2;
   s2= temp;
   System.out.println("After swapping: "+s1+ " "+s2);

		
	}

}
